// todo create conditional to check if polling is done
cy.get('div[data-testid=\'Dashboard-Description-CalculationStatusesCalculatingPercent\']').as('calculatingStatus');
cy.get('div[data-testid=\'Dashboard-Description-CalculationStatusesCalculatedPercent\']').as('calculatedStatus');
cy.get('div[data-testid=\'Dashboard-Description-CalculationStatusesCommittedPercent\']').as('committedStatus');
cy.get('div[data-testid=\'Dashboard-Description-CalculationStatusesBlockedPercent\']').as('blockedStatus');
cy.get('@calculatingStatus').then(function (el) {
    //cy.log(el)
    var content = el.text();
    if (content === 'Calculating0%') {
        // cy.log("found the paygroup is not Calculating")
        cy.get('[data-testid=\'PayRunToolbar-Icon-MoreVert-popover-menu-button\']').click();
        cy.get('[data-testid=\'PayRunToolbar-MenuItem-Recalculate\']').should('be.visible').click();
        // when we click we are expect Calculation should be kick off in 1 min
        cy.wait(14000);
        cy.get('@calculatingStatus').should('have.text', 'Calculating100%');
        cy.wait(25000);
        cy.get('@calculatedStatus').should('have.text', 'Calculated100%');
    }
    else {
        // we should be able to see the 100 calculate result without error
        var twoMinus = 25000;
        //cy.log("waiting application to queue")
        cy.wait(twoMinus);
        cy.get('@calculatedStatus').should('have.text', 'Calculated100%');
    }
});
