// graphql api call for check types
/*
     *   Queue preview DAta
     *   path:"/PayrollUI/DataEntry/QueuePayrollPreviewDataCreation"
     *   params: {"payRunId":20180614044,"previewTypeId":1,"orgUnitId":null,"previewIdentity":null,"filters":{"FilterGrouping":"AND","Filters":[]}}
     *   expectResult: {"PreviewIdentity":"4a1c7054-9d4c-4ce6-ab69-72808f28437a"}
     *   preview result
     *   path: "/PayrollUI/DataEntry/GetPayrollPreviewItems"
     *   paramters:{"PayRunId":20180614044,"OrgUnitId":null,"PreviewIdentity":"4a1c7054-9d4c-4ce6-ab69-72808f28437a","CountryCode":"USA"}
     *   expectResult: {}
     * */
var applicationPath = AppSettingsData.applicationPath, clientBrowserId = AppSettingsData.clientBrowserId, company = AppSettingsData.company, currentOrgId = AppSettingsData.currentOrgId;
var applicationRequestUrl = "/".concat(applicationPath, "/u/").concat(clientBrowserId, "/PayrollMicroFrontendGraphqlGateway/PayrollInfoServiceAPI/graphql");
var checkQuery = '{"operationName":"checkTypes","variables":{"includeAllType":true},"query":"query checkTypes($ctx: ServiceContextInput!, $includeAllType: Boolean!) {\\n  checkTypes(ctx: $ctx, includeAllType: $includeAllType) {\\n    payRunCheckTypeId\\n    shortName\\n    codeName\\n    xrefCode\\n  }\\n}"}';
// cy.request('POST', applicationRequestUrl, checkQuery)
cy.request({
    method: 'POST',
    url: applicationRequestUrl,
    body: checkQuery,
    headers: {
        'Accept': 'application/graphql-response+json',
        'content-type': 'application/json'
    }
}).then(function (res) {
    cy.log(JSON.stringify(res.body));
});
